import React, {Component} from 'react';
import {Card, Button} from 'react-bootstrap';
import vasoEyesDown from '../images/vaso-eyesDown.jpg';
import vasoBar from '../images/vaso-bar.jpg'

class SignUp extends Component {
    render() {
        return (
            <div>
                <Card className="flex flex-column border-0 justify-content-center">

                <div className="flex flex-row bg-purple">
                    <Card.Img variant="top" src={vasoEyesDown} className="w-100 p-3" />
                    <Card.Img variant="top" src={vasoBar} className="w-100 p-3" />
                </div>
                
                    <Card.Body>
                    <Card.Text>
                            <h1>Interested in instructor-led online courses?</h1>
                    </Card.Text>
                            <Button className="bg-purple">get a free consultation</Button>
                    </Card.Body>
                </Card>
            </div>

        )
    }
}

export default SignUp;
